import React from "react";
import "./Dashboard.css";

const Dashboard = () => {
  return (
    <div className="dashboard-wrapper">
      {/* Sidebar */}
      <aside className="sidebar">
        <h2>Noteflow</h2>
        <ul>
          <li>All Notes</li>
          <li>Favorites</li>
          <li>Shared</li>
          {/* Trash removed */}
        </ul>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <header>
          <h1>Welcome, User!</h1>
         
        </header>

        <section className="notes-section">
          <div className="note-card">This is your first note</div>
          <div className="note-card">Another note</div>
          <div className="note-card">Sample note</div>
        </section>

        <button className="add-note-btn">+ Add Note</button>
      </main>
    </div>
  );
};

export default Dashboard;
